import React, { Component } from 'react';
import backArrow from './left-arrow.png';
import './FishbowlProject.css';
import * as Scroll from 'react-scroll';
let Link = Scroll.Link;
import { useHistory } from "react-router-dom";



export default class FishbowlProject extends Component {
  render() {
    return(
        <div className="main-fishbowl">
          <div className="pageTitle-fishbowl">
            fishbowl
          </div>
          <button onClick={() => useHistory().goBack()}>hey</button>
          <a href='/'>
            <div className="arrowDiv">
              <img className="scrollArrow" src={backArrow}/>
            </div>
          </a>
        </div>

    );
  }
}
